export default (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s,t,u,v,w,x,y,z,A,B,C,D,E,F,G,H,I,J,K,L){return {data:{"/portfolio/magic-popups":{project:{_path:"\u002Fportfolio\u002Fmagic-popups",_dir:j,_draft:f,_partial:f,_locale:k,_empty:f,title:u,description:"Easily add lightweight and customizable popups to your WordPress site. This plugin allows you to create and customize as many popups as you wish. These popups are very lightweightand will not slow down your website.",keywords:"WordPress, Development, Themes, Plugins, PHP",image:"\u002Fimages\u002Fproject-magic-popups-thumbnail.webp",banner:"\u002Fimages\u002Fproject-magic-popups-banner.webp",date:"5",type:"Web Dev",tags:["Wordpress","Plugin",l,"PHP"],body:{type:m,children:[{type:a,tag:n,props:{id:"magic-popups"},children:[{type:b,value:u}]},{type:a,tag:c,props:{},children:[{type:b,value:"Magic Popups is a WordPress plugin which allows you to easily add lightweight and customizable popups to your WordPress site. This was my first 'official' WordPress plugin, and got approved to appear in their "},{type:a,tag:h,props:{href:v,target:i},children:[{type:b,value:"plugin repository"}]},{type:b,value:"."}]},{type:a,tag:c,props:{},children:[{type:b,value:"I originally started this project to test the water with using Vue 3 to develop WordPress plugins. It took some configuration, but I finally got it working with relatively good developer experience."}]},{type:a,tag:c,props:{},children:[{type:b,value:"The plugin provides these features:"}]},{type:a,tag:o,props:{},children:[{type:a,tag:d,props:{},children:[{type:b,value:"Choose which pages the popup is displayed on."}]},{type:a,tag:d,props:{},children:[{type:b,value:"Choose how often a user sees each popup (daily, weekly, etc)."}]},{type:a,tag:d,props:{},children:[{type:b,value:"Set an opening delay, ensuring your popup does not appear instantly."}]},{type:a,tag:d,props:{},children:[{type:b,value:"Set a title and description."}]},{type:a,tag:d,props:{},children:[{type:b,value:"Add a custom button with a URL."}]}]},{type:a,tag:c,props:{},children:[{type:a,tag:h,props:{href:"https:\u002F\u002Fgithub.com\u002Fmattfletcher94\u002Fmagic-popups-wordpress-plugin",target:i},children:[{type:b,value:"See GitHub Repo"}]}]},{type:a,tag:c,props:{},children:[{type:a,tag:h,props:{href:v,target:i},children:[{type:b,value:"See WordPress Plugin page"}]}]},{type:a,tag:c,props:{},children:[{type:a,tag:h,props:{href:"\u002Fblog\u002Fhow-to-add-custom-popups-to-your-wordpress-website-with-magic-popups"},children:[{type:b,value:"See Full Tutorial"}]}]}],toc:{title:p,searchDepth:e,depth:e,links:[]}},_type:q,_id:"content:portfolio:magic-popups.md",_source:r,_file:"portfolio\u002Fmagic-popups.md",_extension:s},surrounds:[{_path:"\u002Fportfolio\u002Fkanban-board",_dir:j,_draft:f,_partial:f,_locale:k,_empty:f,title:"Kanban Board | Offline (Electron app)",description:"Kanban Board | Offline is a simple and flexible electron app that aids in managing projects and maximizing your productivity - build Kanban Boards that fit the needs of your project.",keywords:"Vuejs, Kanban Board, Product Management, Electron",image:w,banner:w,type:"Electron App",date:"6",tags:["Electron",l,"Pinia","Tailwind","UI\u002FUX"],body:{type:m,children:[{type:a,tag:n,props:{id:"kanban-board-offline-vuejs-electron-app"},children:[{type:b,value:"Kanban Board | Offline (Vue.js, Electron app)"}]},{type:a,tag:c,props:{},children:[{type:b,value:"\"Kanban Board | Offline\" is a simple and flexible visual tool that aids in managing projects and maximizing your productivity - build Kanban Boards that fit the needs of your project."}]},{type:a,tag:c,props:{},children:[{type:a,tag:h,props:{href:"https:\u002F\u002Fwww.microsoft.com\u002Fstore\u002FproductId\u002F9NXK08Z8JDVB",target:i},children:[{type:b,value:"See Microsoft Store Listing"}]}]},{type:a,tag:g,props:{id:x},children:[{type:b,value:y}]},{type:a,tag:c,props:{},children:[{type:b,value:"I had just landed a new job as a Front-end developer working on a Product management software tool and wanted to immerse myself into the Product management world. Furthermore, I've been interested in building a desktop application using Electron - so this was the perfect opportunity. I also had the chance to exercise my design and UX skills - ensuring the smoothest experience possible for my users. After some trial and error, I built the Electron app as a signed appX file and published it to the Microsoft store."}]},{type:a,tag:g,props:{id:z},children:[{type:b,value:A}]},{type:a,tag:o,props:{},children:[{type:a,tag:d,props:{},children:[{type:b,value:"Create unlimited and fully customizable Kanban boards."}]},{type:a,tag:d,props:{},children:[{type:b,value:"Create and order columns to fit your project's needs."}]},{type:a,tag:d,props:{},children:[{type:b,value:"Create unlimited custom labels from a varied colour palette."}]},{type:a,tag:d,props:{},children:[{type:b,value:"Cards can be added to columns and then moved (drag and drop) as they progress."}]},{type:a,tag:d,props:{},children:[{type:b,value:"Cards can be as detailed as you wish, with a title, description, labels, resource links and To-Do lists."}]}]},{type:a,tag:g,props:{id:B},children:[{type:b,value:C}]},{type:a,tag:o,props:{},children:[{type:a,tag:d,props:{},children:[{type:b,value:"Select from five unique themes."}]},{type:a,tag:d,props:{},children:[{type:b,value:"Modern and intuitive user interface."}]},{type:a,tag:d,props:{},children:[{type:b,value:"No Sign-up, no Wi-Fi, and no ads."}]},{type:a,tag:d,props:{},children:[{type:b,value:"Regular updates with new features."}]}]}],toc:{title:p,searchDepth:e,depth:e,links:[{id:x,depth:e,text:y},{id:z,depth:e,text:A},{id:B,depth:e,text:C}]}},_type:q,_id:"content:portfolio:kanban-board.md",_source:r,_file:"portfolio\u002Fkanban-board.md",_extension:s},{_path:"\u002Fportfolio\u002Finteractive-map",_dir:j,_draft:f,_partial:f,_locale:k,_empty:f,title:"Interactive Map",description:"The Interactive Holiday Park Map project's objective was to make the process of booking a holiday and exploring a holiday park a more immersive and satisfying experience.",keywords:"Vuejs, Interactive Map, Holiday Park, MongoDB, Node.js",image:"\u002Fimages\u002Fproject-interactive-map-thumbnail.webp",banner:"\u002Fimages\u002Fproject-interactive-map-banner.webp",type:"Full Stack Project",date:"4",tags:[l,t,"MongoDB","Express","WebGL"],body:{type:m,children:[{type:a,tag:n,props:{id:"iteractive-map"},children:[{type:b,value:"Iteractive Map"}]},{type:a,tag:c,props:{},children:[{type:b,value:"This project was my dissertation while studying Computer Science at Plymouth University and received a strong first."}]},{type:a,tag:c,props:{},children:[{type:a,tag:h,props:{href:"https:\u002F\u002Fgithub.com\u002Fmattfletcher94\u002Finteractive-map",target:i},children:[{type:b,value:"See Github Repo"}]}]},{type:a,tag:c,props:{},children:[{type:a,tag:h,props:{href:"https:\u002F\u002Fyoutu.be\u002FHku3ORswnwE",target:i},children:[{type:b,value:"See Demo Video"}]}]},{type:a,tag:g,props:{id:D},children:[{type:b,value:E}]},{type:a,tag:c,props:{},children:[{type:b,value:"The Interactive Holiday Park Map project's main objective was to make the process of\nbooking a holiday and exploring a holiday park a more immersive and satisfying\nexperience. This was accomplished by providing Holiday Park Owners\nwith the ability to annotate their Holiday Park maps. Each with its own unique\nconfiguration, the annotations mark anything from park facilities to camping\npitches. Holiday Parks that use the Pitched Booking system can integrate it into their\nInteractive Map, linking the system's units with their map annotations. Holiday\nSearchers could then view the Map, click on individual annotations to view more\ninformation, and search for availability to get a visual representation of which holiday\npitches or caravans are available on their desired arrival date. For instance, those\ninterested in fishing might want to reserve a caravan near the fishing lake."}]},{type:a,tag:g,props:{id:F},children:[{type:b,value:G}]},{type:a,tag:c,props:{},children:[{type:b,value:"The Interactive Holiday Park Map can be broken down into a collection of deliverables,\neach with its own set of tasks and priorities. These deliverables were reached\nbefore the application was published. Each project has both end-to-end and unit tests."}]},{type:a,tag:g,props:{id:H},children:[{type:b,value:I}]},{type:a,tag:c,props:{},children:[{type:b,value:"The first application, referred to as the Back Office, will be for Holiday Park owners to\ncreate and annotate their interactive maps. It will be set out like an admin dashboard\nand require the user to log in to access it. This application was built using\nVue and BootstrapVue, along with Pixi.js to render the map."}]},{type:a,tag:g,props:{id:J},children:[{type:b,value:K}]},{type:a,tag:c,props:{},children:[{type:b,value:"The second application, referred to as the Embedded Map, will present the interactive\nMap to Holiday searchers. The application can be linked directly or embedded onto\nHoliday Parks' websites and works equally well on desktop and mobile devices.\nThis application was built using Vue, along with Pixi.js to render the map."}]},{type:a,tag:g,props:{id:L},children:[{type:b,value:t}]},{type:a,tag:c,props:{},children:[{type:b,value:"The REST API, which drives both web applications and follow standard REST\nprotocol. Some routes are protected using a JWT authentication mechanism. The\nREST API provides developers with a page of auto-generated documentation.\nThe REST API was built using Node, Express, TSOA and Mongoose with a MongoDB."}]}],toc:{title:p,searchDepth:e,depth:e,links:[{id:D,depth:e,text:E},{id:F,depth:e,text:G},{id:H,depth:e,text:I},{id:J,depth:e,text:K},{id:L,depth:e,text:t}]}},_type:q,_id:"content:portfolio:interactive-map.md",_source:r,_file:"portfolio\u002Finteractive-map.md",_extension:s}]}},prerenderedAt:1674981749963}}("element","text","p","li",2,false,"h2","a","_blank","portfolio","en","Vue.js","root","h1","ul","","markdown","content","md","REST API","Magic Popups","https:\u002F\u002Fwordpress.org\u002Fplugins\u002Fmagic-popups-customizable-and-lightweight\u002F","\u002Fimages\u002Fproject-kanban-board.webp","intro","Intro","main-features","Main Features:","additional-features","Additional Features:","objectives","Objectives","project-deliverables","Project Deliverables","web-application-back-office","Web Application: Back Office","web-application-embedded-map","Web Application: Embedded Map","rest-api"))